//import logo from './logo.svg';
import './App.css';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap';

//Seccion de componentes
import ListarCurso from './ComponetsCurso/index';
import Dashboard from './CoimponentsPlantilla/dashboard';
import Menu from './CoimponentsPlantilla/menu';
import {Route, BrowserRouter as Router} from 'react-router-dom';
import ListarGrupo from './ComponentsGrupo';
import ListarEstudiante from './ComponentsEstudiante';

function App() {
  return (
    <div className='container'>
      <Menu></Menu>
      <Router>
        <Route exact path="/" component={Dashboard}></Route>  
        <Route  path="/ListarCurso" component={ListarCurso}></Route>
        <Route  path="/ListarGrupo" component={ListarGrupo}></Route>
        <Route  path="/ListarEstudiante" component={ListarEstudiante}></Route>
      </Router>

    </div>
  );
}

export default App;
